import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import DietInsufficient from './DietInsufficient'; // Ensure these imports are correct
import DietNormal from './DietNormal'; // Example for another component
import DietOverweight1 from './DietOverweight1'; // Import other components as needed
import DietOverweight2 from './DietOverweight2'; // Import other components as needed
import DietObesity1 from './DietObesity1'; // Import other components as needed
import DietObesity2 from './DietObesity2'; // Import other components as needed
import DietObesity3 from './DietObesity3'; // Import other components as needed

function App() {
  const [formData, setFormData] = useState({
    gender: '',
    age: '',
    height: '',
    weight: '',
    family_history_with_overweight: '',
    FAVC: '',
    FCVC: '',
    NCP: '',
    CAEC: '',
    SMOKE: '',
    CH2O: '',
    FAF: '',
    TUE: '',
    CALC: '',
    MTRANS: '',
  });

  const [result, setResult] = useState('');
  const [predictionUrl, setPredictionUrl] = useState('');
  const [fact, setFact] = useState('');

  const facts = [
    "It takes the brain 20 minutes to sense that a person is full.",
    "Women with post-traumatic stress disorder are more likely to be overweight or obese.",
    "One in three U.S. children and teens are overweight or obese.",
    "Childhood obesity affects self-esteem, which can affect employment and higher education later in life.",
    "Obesity prevalence was highest among U.S. adults with a high school diploma or some college education."
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      const randomFact = facts[Math.floor(Math.random() * facts.length)];
      setFact(randomFact);
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }

      const resultData = await response.json();
      const predictionValue = resultData.prediction;
      const predictionText = getPredictionText(predictionValue);

      setResult(predictionText);
      setPredictionUrl(getPredictionUrl(predictionValue));

    } catch (error) {
      console.error('Error during fetch:', error);
    }
  };

  const getPredictionText = (value) => {
    switch (value) {
      case 0: return 'Insufficient weight';
      case 1: return 'Normal weight';
      case 2: return 'Overweight Level 1';
      case 3: return 'Overweight Level 2';
      case 4: return 'Obesity Level 1';
      case 5: return 'Obesity Level 2';
      case 6: return 'Obesity Level 3';
      default: return 'Unknown';
    }
  };

  const getPredictionUrl = (value) => {
    switch (value) {
      case 0: return '/diet-insufficient';
      case 1: return '/diet-normal';
      case 2: return '/diet-overweight1';
      case 3: return '/diet-overweight2';
      case 4: return '/diet-obesity1';
      case 5: return '/diet-obesity2';
      case 6: return '/diet-obesity3';
      default: return '/';
    }
  };

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Obesity Risk Prediction</h1>
        </header>
        <Routes>
          <Route path="/" element={
            <>
              <form onSubmit={handleSubmit}>
                <div className="form-container">
                  <div className="form-column">
                    {/* Form Fields */}
                    {/* Same as before */}
                  </div>
                  <div className="form-column">
                    {/* Form Fields */}
                    {/* Same as before */}
                  </div>
                </div>
                <button type="submit">Predict</button>
              </form>
              <div>
                <h2>Prediction Result:</h2>
                <pre>{result}</pre>
                {predictionUrl && <a href={predictionUrl} target="_blank" rel="noopener noreferrer">View Dietary Recommendations</a>}
              </div>
            </>
          } />
          <Route path="/diet-insufficient" element={<DietInsufficient />} />
          <Route path="/diet-normal" element={<DietNormal />} />
          <Route path="/diet-overweight1" element={<DietOverweight1 />} />
          <Route path="/diet-overweight2" element={<DietOverweight2 />} />
          <Route path="/diet-obesity1" element={<DietObesity1 />} />
          <Route path="/diet-obesity2" element={<DietObesity2 />} />
          <Route path="/diet-obesity3" element={<DietObesity3 />} />
        </Routes>
        <footer className="App-footer">
          <h2>Did You Know?</h2>
          <p>{fact}</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
